import React, { Component } from 'react';
import { FormControl, FormGroup, Col, ControlLabel, Button } from 'react-bootstrap';
import './App.css';

class App extends Component {

  constructor(){
    this
  }

    handleChange(e) {
    this.setState({ [e.value]: e.target.value });
  }


  render() {
    return (
      <div className="App">
        <div className="header">  
        <img src="logo.png" style={{margin:'12px'}} alt=""/></div>
        <div className="body">
          <FormGroup controlId="formHorizontalEmail">
            <Col componentClass={ControlLabel} sm={2}>
              Send
            </Col>
            <Col sm={10}>
              <FormControl type="email" placeholder="Email" onChange={this.handleChange}/>
            </Col>
          </FormGroup>
          <br/>
          <br/>
          <FormGroup controlId="formHorizontalPassword">
            <Col componentClass={ControlLabel} sm={2}>
              Password
            </Col>
            <Col sm={10}>
              <FormControl type="password" placeholder="Password" onChange={this.handleChange} />
            </Col>
          </FormGroup>
          <Button bsStyle="primary">Send</Button>
        </div>
      </div>
    );
  }
}

export default App;
